package main

import "fmt"

func findTheDifference(s string, t string) byte {
	if len(s) == 0 {
		return t[0]
	}
	d := make(map[byte]int)
	for i := 0; i < len(s); i++ {
		d[s[i]]++
	}

	for i := 0; i < len(t); i++ {
		d[t[i]]--
		if d[t[i]] < 0 {
			return t[i]
		}
	}
	return 0
}

func main() {
	fmt.Println(string(findTheDifference("abcd", "abcde")))
	fmt.Println(string(findTheDifference("", "y")))
	fmt.Println(string(findTheDifference(
		"",
		"",
	)))
}
